import React from 'react';
import ReactDOM from 'react-dom';
let object = {
  avatarUrl: "{https://www.w3schools.com/js/js_object_properties.asp}",
  athor: "Marat",
  text:"Some text",
  date: "12/08/2010"
}
UserInfo(object.text);
Avatar({object});
CommentText({object});
CommentDate({object});

let UserInfoName = (props) => <div>{props.text}</div>;
let Avatar       = (props) => <img src="{props.athor.avatarUrl}"></img>;
let CommentText  = (props) => <div>{props.text}</div>;
let CommentDate  = (props) => <div>{props.date}</div>

let UserInfo = () => <div><Avatar/>,<UserInfoName/></div>;
let Comment = () => <div><UserInfo/>,<CommentText/>,<CommentDate/></div>;

let App = () => (
                <div>
                  <Comment/>
                </div>
              );


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
